from decimal import Decimal, ROUND_HALF_UP
import json

def convert_to_decimal(amount_str):
    """
    Converts a Contribution_Amount value to a Decimal rounded to two decimal places.

    :param amount_str: The Contribution_Amount as a string.
    :return: The rounded Decimal value.
    """
    try:
        # Convert the string to a Decimal
        amount = float(amount_str.replace(",",""))
        # Round to two decimal places using ROUND_HALF_UP
        rounded_amount = round(amount, 2)
        return rounded_amount
    except (ValueError, TypeError) as e:
        print(f"Error converting amount: {amount_str}. Error: {e}")
        return None

